<html>
<head>
    <link href="https://fonts.googleapis.com/css2?family=Roboto&display=swap" rel="stylesheet">
    <style>
        body {
            font-family: 'Roboto', Verdana, sans-serif;
            background: #fff;
            margin: 10px;
        }
		
		td:first-child{
			border:1px solid black;
		}
		td{
			padding-left:20px;
			padding-right:20px;
			margin:8px;
		}

        .question {
            margin-bottom: 75px;
        }

        img.icon {
            width: 64px !important;
        }
		img.icon.orange{
			width: 56px !important;
		}

        span.icon {
            font-size: 50px;
            color: #aaa;
			position:relative;
			top:-16px;
        }
		img.elt{
			width:100px !important;
		}

        .question .header {
            font-weight: bold;
            font-size: xx-large;
            text-transform: uppercase;
            background: red;
            color: white;
            padding: 6px;
            display: inline-block;
            transform: rotate(-3deg);
        }

        .question img, .question .imglabel {
            width: 300px;
			margin:20px;
        }

        .question img.large {
            width: 800px;
        }

        .question .task {

        }

        .question div {
            border: 1px solid #222;
            padding: 12px;
            display: inline-block;
            margin: 10px;
            background: #fff;
        }

        pre {
            color: blue;
            font-family: 'Roboto', Verdana, sans-serif;
        }

        pre span {
            filter: blur(5px);
            font-size: larger;
            color: #666;
        }

        .q4 {
            margin: 6px;
            border: 1px solid black;
            padding: 8px;
            display: inline-block;
            font-family: 'Roboto', Verdana, sans-serif;
            font-size: larger;
            background: #222;
            min-width: 120px;
            color: #aaa;
        }

        .q4.empty {
            color: white;
            text-align: center;
        }
    </style>
</head>
